import PlacesAutocomplete, {
  geocodeByAddress,
  getLatLng,
} from 'react-places-autocomplete';
import axios from "axios";
class Search extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      address: '',
      currentLocation: null,
      initialSuggestions: [],
      latitude: null,
      longitude: null,
      isChanged: false,
    };
